import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { FileText, ExternalLink, Calendar, Users, Award } from 'lucide-react';
import './Publications.css';

const Publications = () => {
  const [activeFilter, setActiveFilter] = useState('all');

  const publications = [
    {
      title: 'Advanced Machine Learning Algorithms for Predictive Analytics',
      authors: 'Smith, J., Johnson, A., Williams, B.',
      journal: 'Journal of Computer Science',
      year: 2023,
      doi: '10.1000/example.2023.001',
      type: 'journal',
      impact: 'High Impact',
      citations: 45,
      abstract: 'This paper presents novel machine learning algorithms that significantly improve predictive analytics performance in various domains.'
    },
    {
      title: 'Sustainable Energy Solutions: A Comprehensive Review',
      authors: 'Brown, M., Davis, R., Miller, S.',
      journal: 'Energy Research & Development',
      year: 2023,
      doi: '10.1000/energy.2023.002',
      type: 'journal',
      impact: 'Medium Impact',
      citations: 23,
      abstract: 'A comprehensive review of sustainable energy technologies and their implementation strategies.'
    },
    {
      title: 'Biomedical Imaging Enhancement Using AI',
      authors: 'Wilson, T., Anderson, K., Taylor, L.',
      journal: 'Medical Imaging Technology',
      year: 2022,
      doi: '10.1000/medical.2022.003',
      type: 'journal',
      impact: 'High Impact',
      citations: 67,
      abstract: 'Novel AI-driven approaches for enhancing medical imaging quality and diagnostic accuracy.'
    },
    {
      title: 'Conference Paper: Future of Renewable Energy',
      authors: 'Garcia, M., Rodriguez, P., Martinez, J.',
      journal: 'International Conference on Energy Systems',
      year: 2023,
      doi: '10.1000/conference.2023.004',
      type: 'conference',
      impact: 'Conference',
      citations: 12,
      abstract: 'Presented at the International Conference on Energy Systems, discussing future trends in renewable energy.'
    },
    {
      title: 'Book Chapter: Machine Learning in Healthcare',
      authors: 'Lee, S., Kim, J., Park, H.',
      journal: 'Advances in Healthcare Technology',
      year: 2022,
      doi: '10.1000/book.2022.005',
      type: 'book',
      impact: 'Book Chapter',
      citations: 8,
      abstract: 'A comprehensive chapter on the application of machine learning techniques in healthcare systems.'
    }
  ];

  const filters = [
    { key: 'all', label: 'All Publications' },
    { key: 'journal', label: 'Journal Papers' },
    { key: 'conference', label: 'Conference Papers' },
    { key: 'book', label: 'Book Chapters' }
  ];

  const filteredPublications = activeFilter === 'all' 
    ? publications 
    : publications.filter(pub => pub.type === activeFilter);

  const stats = [
    { label: 'Total Publications', value: publications.length },
    { label: 'Journal Papers', value: publications.filter(p => p.type === 'journal').length },
    { label: 'Conference Papers', value: publications.filter(p => p.type === 'conference').length },
    { label: 'Total Citations', value: publications.reduce((sum, pub) => sum + pub.citations, 0) }
  ];

  return (
    <section className="publications section" id="publications">
      <div className="container">
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          <h2 className="section-title">Publications</h2>
          <p className="section-subtitle">
            Academic publications and research contributions that demonstrate expertise and impact
          </p>
        </motion.div>

        <motion.div 
          className="publication-stats"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.2 }}
          viewport={{ once: true }}
        >
          {stats.map((stat, index) => (
            <div key={index} className="stat-card">
              <div className="stat-number">{stat.value}</div>
              <div className="stat-label">{stat.label}</div>
            </div>
          ))}
        </motion.div>

        <motion.div 
          className="publication-filters"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.4 }}
          viewport={{ once: true }}
        >
          <div className="filter-buttons">
            {filters.map((filter) => (
              <button
                key={filter.key}
                className={`filter-btn ${activeFilter === filter.key ? 'active' : ''}`}
                onClick={() => setActiveFilter(filter.key)}
              >
                {filter.label}
              </button>
            ))}
          </div>
        </motion.div>

        <motion.div 
          className="publications-list"
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.6 }}
          viewport={{ once: true }}
        >
          {filteredPublications.map((publication, index) => (
            <motion.div
              key={index}
              className="publication-card card"
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              viewport={{ once: true }}
              whileHover={{ y: -5 }}
            >
              <div className="publication-header">
                <div className="publication-type">
                  <FileText size={20} />
                  <span className={`type-badge ${publication.type}`}>
                    {publication.type.charAt(0).toUpperCase() + publication.type.slice(1)}
                  </span>
                </div>
                <div className="publication-meta">
                  <span className="impact-badge">{publication.impact}</span>
                </div>
              </div>

              <h3 className="publication-title">{publication.title}</h3>
              
              <div className="publication-authors">
                <Users size={16} />
                <span>{publication.authors}</span>
              </div>

              <div className="publication-journal">
                <span className="journal-name">{publication.journal}</span>
                <span className="publication-year">
                  <Calendar size={16} />
                  {publication.year}
                </span>
              </div>

              <p className="publication-abstract">{publication.abstract}</p>

              <div className="publication-footer">
                <div className="publication-citations">
                  <Award size={16} />
                  <span>{publication.citations} citations</span>
                </div>
                <div className="publication-links">
                  <span className="doi">DOI: {publication.doi}</span>
                  <a 
                    href={`https://doi.org/${publication.doi}`} 
                    target="_blank" 
                    rel="noopener noreferrer"
                    className="external-link"
                  >
                    <ExternalLink size={16} />
                    View Paper
                  </a>
                </div>
              </div>
            </motion.div>
          ))}
        </motion.div>
      </div>
    </section>
  );
};

export default Publications;
